// reducer - אחראי על שינוי הסטייט
// שם מקובל - לא חובה
// produce הרצה של הפונקציה 
// מקבלת שני ארגומנטים:
// 1. פונקציית חץ
// 2. הסטייט שעליו נפעיל את השינויים
const reducer = produce((state, action) => {
    switch (action.type) {
        case 'SET_CURRENT_USER':
            state.currentUser = action.payload
            break;
        case 'ADD_USER':
            state.users.push(action.payload);
            break;
        case 'ADD_LENDINGCAR':
            state.lending.push(action.payload);
            break;
        case 'UPDATE_CAR':
            state.cars[action.payload.index]=action.payload.item
             break;
        case 'UPDATE_ANAA':
             state.propulsion[action.payload.index]=action.payload.item
             break;
        case 'ADD_CAR':
                state.cars.push(action.payload);
                break;
        case 'ADD_CAR':
              state.cars.splice(action.payload);
               break;
        default:
    }
}, initialState)





